import ExpenseItem from "./ExpenseItem";

function ExpenseList(props) {
    return (
        <ul>
          {props.expenses.map((i) => (
            <li>
             <ExpenseItem
                title={props.expenses[i].title}
                amount={props.expenses[i].amount}
                date={props.expenses[i].date}
                />
            </li>
          ))}
        </ul>
      );
}

export default ExpenseList
